body:
The enforces checkstyle rules for the main Tamaya code.

In general, the existing checkstyle rules remain the same and the code has been adjusted to align to that. The only changes made to the checkstyle rules was to add some additional exclusions to the `AvoidStarImport` rule; the following packages were added: 
 
* java.lang.annotation
* org.osgi.framework
* org.apache.tamaya
* org.apache.tamaya.spi
* org.apache.tamaya.core.internal.converters

The `OSGIServiceLoader` was almost entirely replaced because tabs were replaced with spaces. The code there stays the same, but one change was made (to align with another checkstyle rule):

This:

```java
for (Bundle bundle : context.getBundles()) {
	switch (bundle.getState()) {
	case Bundle.ACTIVE:
		checkAndLoadBundle(bundle);
	}
}
```

was changed to this (checkstyle doesn't allow `switch` statements without a `default` branch):
```java
for (Bundle bundle : context.getBundles()) {
     if (bundle.getState() == Bundle.ACTIVE) {
         checkAndLoadBundle(bundle);
     }
}
```
